import React, { useState } from "react";
import NavbarStyle from "./style";

const Navbar = () => {
  return (
    <NavbarStyle>
      <div className="logo">Logo</div>
      <div class="cart-container">
        <div class="sign-up">Sign up</div>
        <div class="cart">cart</div>
      </div>
    </NavbarStyle>
  );
};

export default Navbar;
